%[text] # Modeling Osmotic Pressure in Simscape
%[text] 
%[text] Osmotic pressure is a fundamental concept in chemistry and biology, describing the force required to prevent the flow of solvent molecules through a semipermeable membrane separating two solutions of different concentrations. This phenomenon is driven by the natural tendency of solvent molecules (often water) to move from a region of lower solute concentration to one of higher solute concentration to equalize concentrations on both sides of the membrane.
%[text] ![](text:image:212e)
%[text] Mathematically, osmotic pressure, $\\Pi${"editStyle":"visual"}, for dilute solutions can be described by the [van 't Hoff equation](internal:M_8842):
%[text] $\\Pi =i\\;M\\;R\\;T${"editStyle":"visual"}
%[text] where:
%[text] - $i${"editStyle":"visual"} is the van 't Hoff factor (number of particles the solute splits into),
%[text] - $M${"editStyle":"visual"} is the molar concentration of the solute,
%[text] - $R${"editStyle":"visual"} is the universal gas constant,
%[text] - $T${"editStyle":"visual"} is the absolute temperature (in Kelvin). \
%[text] 
%[text] Osmotic pressure plays a crucial role in biological systems, industrial processes, and laboratory techniques such as dialysis and reverse osmosis. Understanding this concept helps in predicting the movement of fluids across membranes, designing separation processes, and explaining cellular behavior in different environments.
%[text] ## Manometer with Semipermeable Membrane
%[text] First, we compute the column height difference statically by solving the force balance equations. The osmotic pressure, $p\_{\\mathrm{os}}${"editStyle":"visual"}, on the column of salty water is
%[text] $p\_{\\mathrm{os}} =\\frac{i\\;m\_0 \\;R\\;T}{M\_{\\mathrm{N}\\mathrm{a}\\mathrm{C}\\mathrm{l}\\;} A\\;\\left(\\frac{x}{2}+h\_0 \\right)}${"editStyle":"visual"},
%[text] where $M\_{\\mathrm{NaCl}}${"editStyle":"visual"} is the molar mass of the salt, $A${"editStyle":"visual"} is the column area, $m\_0${"editStyle":"visual"} is the initial mass of salt, $h\_0${"editStyle":"visual"} is the initial column height and $x${"editStyle":"visual"} is the difference in heights of the pure and salty columns. Balancing this with the pressure gravity exerts on the column height difference, *i.e.*,
%[text] $p\_g =\\rho \\;g\\;x${"editStyle":"visual"},
%[text]  we can solve for the column height difference. Here, we assume the density of the salt is small compared to the density of water. The MATLAB code for this calculation is here:
% Open the project file to set up model paths
openProject("ssc_desal.prj");

% Parameter definitions for static calculations
A = 1/100^2;          % [m^2] Cross sectional area
h0 = 0.5;             % [m] Initial column height
ii = 2;               % [1] Charge for NaCl -- there are 2 ions
c = 0.05;             % [kg/m^3] Salt mass concentration in solution
m0 = c*A*h0;          % [kg] Salt mass in salty column
M_NaCl = 0.05844;     % [kg/mol] Molar mass of NaCl
M = c/M_NaCl;         % [mol/m^3] Molar concentration of NaCl    
R = 8.314;            % [J/(mol*K)]
T = 293.15;           % [K] Temperature

% Osmotic Pressure via van 't Hoff equation:
pi_os = ii*M*R*T;       % [Pa] 
% Fluid properties
rho = 998.2;         % [kg/m^3] Water density (approximate)
g = 9.81;            % [m/s^2] Gravitational acceleration

% Approximate column height difference (first term on rhs is osmotic pressure,
% second is gravity)
fnc = @(x)ii*m0/M_NaCl/A/(x/2+h0)*R*T - rho*g*x;
delta_h_calc = fzero(fnc, 0.0) %[output:719700af]
%%
%[text] ## Physical Models of the Membrane
%[text] Now that we have the quasi-static solution, we can investigate the time-dependent behavior of the membrane. We'll perform this investigation by creating a custom component for a chamber that will exchange information with the membrane via physical signals. This chamber works by integrating the mass transfers across the membrane model and computing the column height for a given cross-sectional area. From this height and atmospheric pressure parameter it computes the column pressure on the membrane. It does not account for compressibility or temperature. See `simple_chamber.ssc` for the implementation.
%[text]   Here we open a model with two of these chambers connected by a membrane model and run it. The difference in logged values for height at the end of the simulation is computed and agrees with the result above. Since the system is closed, fluid can only transfer from one side to the other, *i.e.*, mass is conserved.
% Test the system with physical signal based chamber.
open_system("simple_manometer");
out1 = sim("simple_manometer");
t1 = out1.simlog.Salt.h.series.time();
h_s1 = out1.simlog.Salt.h.series.values("m");
h_p1 = out1.simlog.Pure.h.series.values("m");
delta_h_sim1 = h_s1(end)-h_p1(end) %[output:7b3b8fef]
%[text] Now that we've checked our interface to the membrane, we'll switch to using the library blocks to accomplish the same results. These blocks account for the dynamic effects of pressure, temperature and concentration in the system and will allow us to connect to other Simscape elements as we'll see below. 
%[text]   To mimic the water column behavior, we can use a pair of translational mechanical converters. In this case, we use the measured height of the water columns to provide the external pressure for the converters. Running this simulation and looking at the logged data, we can see that the column height agrees with the static results. Again, this is a closed system where mass and energy are conserved. Mass, energy and (trace amounts of) salt can move between the two translational mechanical converters via the membrane but nothing can leave or enter the system as a whole. (We'll motivate the change to the more complex model the next section, where we'll turn this configuration into a basic desalinator.)
% Use translational mechanical converter model for the manometer tubes.
open_system("manometer");
out2 = sim("manometer");
t2 = out2.simlog.h_salty.x.series.time();
h_s2 = out2.simlog.h_salty.x.series.values("m");
h_p2 = out2.simlog.h_pure.x.series.values("m");
delta_h_sim2 = h_s2(end)-h_p2(end) %[output:360c453e]
%[text] What's more interesting about these simulations, is that it's possible to examine the dynamic behavior of the simulations. Here we show the column heights changing as a function of time for the first 120 seconds of simulation. We can see from the plot that the column height takes around 100 seconds to equilibrate.
figure; %[output:74192ba2]
clf; %[output:74192ba2]
plot(t2, h_s2, "LineWidth", 2) %[output:74192ba2]
hold on %[output:74192ba2]
grid on %[output:74192ba2]
plot(t2, h_p2, "LineWidth", 2) %[output:74192ba2]
xlim([0, 120]) %[output:74192ba2]
title("Column Heights for Osmotic Pressure Simulation"); %[output:74192ba2]
xlabel("t [s]"); %[output:74192ba2]
ylabel("h [m]") %[output:74192ba2]
legend("Salty Side", "Fresh Side", "Location", "east") %[output:74192ba2]
%%
%[text] ## Creating a Basic Desalinator
%[text] In this section we'll demonstrate the value of the model that uses the translational mechanical converters. Essentially, since the these blocks capture the effects of the pressure dynamics, they are the most accurate. Further, they allow the user to specify a downward force, like that of a plunger, on the columns of water. In `simple_desalinator.slx`, we allow the model to equilibrate per the previous simulation, then apply a downward force to the salty chamber at 300 s. This displaces water across the membrane from the salty side to the pure side. First, we load the model and simulate it:
% Demonstrate a simple desalination process with the dynamic model.
open_system("simple_desalinator");
out3 = sim("simple_desalinator");
t3 = out3.simlog.h_salty.x.series.time();
h_s3 = out3.simlog.h_salty.x.series.values("m");
h_p3 = out3.simlog.h_pure.x.series.values("m");
% Plot the column heights
figure; %[output:2f8713a3]
clf; %[output:2f8713a3]
plot(t3, h_s3, "LineWidth", 2) %[output:2f8713a3]
hold on %[output:2f8713a3]
grid on %[output:2f8713a3]
plot(t3, h_p3, "LineWidth", 2) %[output:2f8713a3]
xlim([0, 360]) %[output:2f8713a3]
title("Column Heights for Desalinator Simulation"); %[output:2f8713a3]
xlabel("t [s]"); %[output:2f8713a3]
ylabel("h [m]") %[output:2f8713a3]
legend("Salty Side", "Fresh Side", "Location", "northwest") %[output:2f8713a3]
%[text] As we can see from the plot, the salty side column is pressed down at 300 s, which causes the pure side height to rise. Now, let's take a closer look at the pressure in the salty chamber and the salt concentration in both chambers. First, we plot the total pressures of the chambers and the components of these pressures. Note that the total pressures are gauge pressures and do not include the pressure of the atmosphere (1.01325 bar), but the osmotic and height difference pressures are absolute.
% Plot the total pressures, osmotic pressures and column height pressures
% for the system
p_s3 = out3.simlog.Salty_Water_Chamber.p_I.series.values("bar");
p_p3 = out3.simlog.Pure_Water_Chamber.p_I.series.values("bar");
pi_membrane = -out3.simlog.Membrane_EQs.del_pi.series.values("bar");
a_xsec = value(simscape.Value(1, "cm^2"), "m^2");
p_applied = -out3.simlog.Fs_in.I1.series.values("N")/a_xsec/1e5;
p_sg3 = -out3.simlog.Fs_in.I2.series.values("N")/a_xsec/1e5;
p_pg3 = -out3.simlog.Fp_in.O.series.values("N")/a_xsec/1e5;

% Create the figure
figure; %[output:9275ffce]
clf %[output:9275ffce]
plot(t3,p_s3-1.01325, "Linewidth", 2); %[output:9275ffce]
hold on %[output:9275ffce]
plot(t3,p_p3-1.01325, "Linewidth", 2); %[output:9275ffce]
plot(t3, pi_membrane, "LineWidth", 2); %[output:9275ffce]
plot(t3, p_applied, "LineWidth", 2); %[output:9275ffce]
plot(t3, p_sg3, "LineWidth", 2, "LineStyle","--"); %[output:9275ffce]
plot(t3, p_pg3, "LineWidth", 2, "LineStyle","--"); %[output:9275ffce]
grid on %[output:9275ffce]
xlabel("t [s]"); %[output:9275ffce]
ylabel("p [bar]"); %[output:9275ffce]
legend("Salty (Total)", "Pure (Total)", "Osmotic Pressure", "Applied Pressure", "Salty (Height)", "Pure (Height)", "Location", "west"); %[output:9275ffce]
%[text] We can also plot the salt concentrations in both chambers. For the first 300 seconds, we see the osmotic pressure forces water into the salty chamber. At this point we apply a downward pressure to the salty chamber which causes reverse osmosis, *i.e.*, the water is pushed back into the pure side, leaving the salt behind. This causes the salt concentration to increase in the salty side while remaining constant in the pure side. This indicates we have desalinated some water from the salty side by pressing down on the column of water.
% Plot the salt concentrations for both chambers
x_s3 = out3.simlog.Salty_Water_Chamber.x_I.series.values("kg/m^3");
x_p3 = out3.simlog.Pure_Water_Chamber.x_I.series.values("kg/m^3");
figure %[output:5a05776c]
clf %[output:5a05776c]
plot(t3,x_s3, t3, x_p3, "LineWidth",2); %[output:5a05776c]
grid on %[output:5a05776c]
xlabel("t [s]"); %[output:5a05776c]
ylabel("x [kg/m^3]"); %[output:5a05776c]
legend("Salty Concentration", "Pure Concentration", "Location", "northwest") %[output:5a05776c]
%[text]  
%%
%[text] %[text:anchor:M_8842] ## Appendix 1: Derivation of van 't Hoff's Equation 
%[text] We'll use the chemical potential balance method to derive the equation of van 't Hoff. Say we have a manometer which has a semi-permeable membrane at the bottom which allows the passage of water but blocks the passage of salt. For this example, let's work with sodium chloride, which divides into a sodium and chlorine ions when dissolved.  We can write the the chemical potential balance as
%[text] $\\mu\_A \\left(p+\\Pi \\;\\right)+R\\;T\\;\\ln \\left(a\_A \\right)=\\mu\_A \\left(p\\right)${"editStyle":"visual"},
%[text] where $\\mu\_A \\left(p\\right)${"editStyle":"visual"} is the chemical potential of a column of pure liquid at pressure $p${"editStyle":"visual"}. The second term on the left hand side is the product of the universal gas constant, $R${"editStyle":"visual"}, the temperature $T${"editStyle":"visual"} and the log of the activity coefficient, $a\_A${"editStyle":"visual"} for the solvent with solute. As above, $\\Pi${"editStyle":"visual"} is the osmotic pressure produced by the concentration gradient of salt across the membrane. Rearranging this equation we get
%[text] $\\mu\_A \\left(p+\\Pi \\right)-\\mu\_A \\left(p\\right)\\;=-R\\;T\\;\\ln \\left(a\_A \\right)${"editStyle":"visual"}.
%[text] Noting the relation for the derivative of chemical potential with respect to the pressure is the partial molar volume of solvent, i.e., 
%[text] $\\frac{\\;\\partial \\;\\mu \\;}{\\partial \\;p}=\\bar{\\;V\_A }${"editStyle":"visual"},
%[text] we can write
%[text] $\\Delta \\;\\mu \\approx \\bar{V\_A } \\;\\Delta p\\ldotp${"editStyle":"visual"}
%[text] Substituting the expression into the chemical potential equation above, we arrive at
%[text] $\\bar{V\_A } \\;\\Delta p=\\bar{V\_A } \\;\\Pi =-R\\;T\\;\\ln \\left(a\_A \\right)${"editStyle":"visual"}.
%[text] As we approach infinite dilution the activity $a\_A${"editStyle":"visual"} approaches 1 and the osmotic pressure goes to zero. If we solve for osmotic pressure in the dilute case, we can write
%[text] $\\Pi =-\\frac{R\\;T\\;}{\\bar{V\_A } }\\;\\ln \\left(a\_A \\right)\\approx -\\frac{R\\;T\\;}{\\bar{V\_A } }\\;\\ln \\left(y\_A \\right)\\approx -\\frac{R\\;T\\;}{\\bar{V\_A } }\\;\\ln \\left(1-y\_B \\right)\\approx \\frac{R\\;T\\;}{\\bar{V\_A } }\\;y\_B${"editStyle":"visual"},
%[text] where $y\_A${"editStyle":"visual"} and $y\_B${"editStyle":"visual"} are the mole fractions of solvent and solute, respectively. Recognizing that $M=\\frac{\\;y\_B }{\\bar{\\;V\_A } }${"editStyle":"visual"} is the molarity of solute and there are two ions (one sodium, and one chlorine) dissolved, we arrive at the van 't Hoff expression:
%[text] $\\Pi =i\\;M\\;R\\;T${"editStyle":"visual"}.
